// Determine next section to write based on status

const state = $('Get Workflow State').first().json;
const sections = $('Get All Sections').all().map(item => item.json);
const requestedSection = $('Webhook Trigger1').first().json.section_key;

// Calculate progress
const completedSections = sections.filter(s => s.status === 'complete');
const totalWords = sections.reduce((sum, s) => sum + (s.word_count || 0), 0);
const totalPages = totalWords / 250;

// Find the next section to work on
let targetSection;
if (requestedSection) {
  targetSection = sections.find(s => s.section_key === requestedSection);
} else {
  targetSection = sections.find(s => s.status !== 'complete');
}

// Get previous sections for context
const previousSections = sections
  .filter(s => s.step_number < targetSection?.step_number && s.content)
  .map(s => ({
    name: s.section_name,
    summary: s.content?.substring(0, 500) + '...',
    word_count: s.word_count
  }));

return [{
  json: {
    current_state: {
      phase: state.current_phase,
      total_words: totalWords,
      total_pages: totalPages,
      completed: completedSections.length,
      total: sections.length,
      progress_percent: (completedSections.length / sections.length * 100).toFixed(1)
    },
    target_section: targetSection,
    previous_sections: previousSections,
    all_sections: sections
  }
}];

