// Parse orchestrator response and prepare RAG queries

let content = $input.first().json.choices[0].message.content;

// Strip markdown code blocks if present
content = content.replace(/```json\n?/g, '').replace(/```\n?/g, '').trim();

const orchestratorResponse = JSON.parse(content);
const targetSection = $('Determine Next Action').first().json.target_section;

const searchQueries = orchestratorResponse.research_queries || [];
const disciplines = orchestratorResponse.disciplines_to_search || [];

return [{
  json: {
    orchestrator_guidance: orchestratorResponse,
    target_section: targetSection,
    search_queries: searchQueries,
    disciplines: disciplines,
    previous_sections: $('Determine Next Action').first().json.previous_sections
  }
}];

const data = $input.first().json;
const queries = data.search_queries;

return [{
  json: {
    queries: queries,
    disciplines: data.disciplines,
    orchestrator_guidance: data.orchestrator_guidance,
    target_section: data.target_section,
    previous_sections: data.previous_sections
  }
}];

const embeddings = $input.first().json.data.map(d => d.embedding);
const queries = $('Prepare Search Queries').first().json.queries;
const disciplines = $('Prepare Search Queries').first().json.disciplines;

return [{
  json: {
    embedding: embeddings[0],
    disciplines_filter: disciplines,
    orchestrator_guidance: $('Prepare Search Queries').first().json.orchestrator_guidance,
    target_section: $('Prepare Search Queries').first().json.target_section,
    previous_sections: $('Prepare Search Queries').first().json.previous_sections
  }
}];

// Compile all retrieved chunks into a context document

const ragResults = $input.first().json;
const guidance = $('Prepare RAG Search').first().json.orchestrator_guidance;
const targetSection = $('Prepare RAG Search').first().json.target_section;

const chunks = Array.isArray(ragResults) ? ragResults : [ragResults];

const seenContent = new Set();
const uniqueChunks = [];

for (const chunk of chunks) {
  if (chunk && chunk.content) {
    const contentHash = chunk.content.substring(0, 100);
    if (!seenContent.has(contentHash)) {
      seenContent.add(contentHash);
      uniqueChunks.push(chunk);
    }
  }
}

uniqueChunks.sort((a, b) => (b.similarity || 0) - (a.similarity || 0));

let context = '';
const citationsUsed = [];

for (const chunk of uniqueChunks.slice(0, 20)) {
  const citation = chunk.chicago_citation || `${chunk.source_title || 'Unknown'} (${(chunk.source_authors || []).join(', ')})`;

  context += `\n\n---\n[Source: ${chunk.source_title || 'Unknown'}]\n`;
  context += `[Section: ${chunk.section_type || 'unknown'}, Page: ${chunk.page_number || 'N/A'}]\n`;
  context += `[Relevance: ${((chunk.similarity || 0) * 100).toFixed(1)}%]\n\n`;
  context += chunk.content;
  context += `\n[Citation: ${citation}]\n---`;

  if (citation && !citationsUsed.includes(citation)) {
    citationsUsed.push(citation);
  }
}

if (uniqueChunks.length === 0) {
  context = '[No relevant sources found in knowledge base. The Writing Agent should note this limitation.]';
}

return [{
  json: {
    context: context,
    citations: citationsUsed,
    chunk_count: uniqueChunks.length,
    orchestrator_guidance: guidance,
    target_section: targetSection,
    previous_sections: $('Prepare RAG Search').item.json.previous_sections
  }
}];

const writtenContent = $input.first().json.choices[0].message.content;
const targetSection = $('Compile RAG Context').first().json.target_section;
const citations = $('Compile RAG Context').first().json.citations;

const wordCount = writtenContent.split(/\s+/).length;
const pageCount = wordCount / 250;

return [{
  json: {
    section_key: targetSection.section_key,
    section_id: targetSection.id,
    content: writtenContent,
    word_count: wordCount,
    page_count: pageCount,
    status: 'review',
    // Store citations as simple count for response, not for DB
    _citations_count: citations.length,
    _citations_list: citations
  }
}];

