const data = $input.first().json;

const systemPrompt = `You are the Writing Agent for an interdisciplinary research paper.

RESEARCH QUESTION:
"How can public health interventions be designed to address the social determinants that maintain health disparities and thus improve health equity in Black communities?"

CRITICAL REQUIREMENTS:
1. ORIGINALITY: All writing must be substantially original analysis
   - Never copy phrases directly from sources
   - Synthesize and paraphrase, then cite
   - Develop your own arguments supported by evidence

2. CITATION: Chicago Manual of Style (Notes-Bibliography system)
   - Use footnotes for citations in format: Author, Title, page.
   - Every claim from a source must be cited

3. ACADEMIC TONE:
   - Third person (avoid "I" except in reflection)
   - Precise, scholarly language
   - Clear argument structure

4. TURNITIN COMPLIANCE:
   - Target <30% similarity score
   - Paraphrase comprehensively
   - Use direct quotes sparingly

SECTION TO WRITE: ${data.target_section?.section_name || 'Unknown'}
STEP NUMBER: ${data.target_section?.step_number || 0}
TARGET WORD COUNT: ${data.orchestrator_guidance?.target_word_count || 500}

KEY POINTS TO COVER:
${(data.orchestrator_guidance?.key_points_to_cover || []).map(p => '- ' + p).join('\n')}

INTEGRATION GUIDANCE:
${data.orchestrator_guidance?.integration_guidance || 'Integrate insights from multiple disciplines.'}

PREVIOUS SECTIONS SUMMARY:
${(data.previous_sections || []).map(s => s.name + ': ' + s.summary).join('\n\n')}

Write the complete section content. Use footnotes for all citations (format: [^1], [^2], etc.). At the end, provide a FOOTNOTES section with all citations in Chicago format.`;

const userPrompt = `Write the ${data.target_section?.section_name || 'section'} section using the following sources:

${data.context}

Remember: Synthesize and analyze, don't just summarize. Every claim needs a citation. Target ${data.orchestrator_guidance?.target_word_count || 500} words.`;

return [{
  json: {
    requestBody: {
      model: "anthropic/claude-sonnet-4",
      messages: [
        { role: "system", content: systemPrompt },
        { role: "user", content: userPrompt }
      ],
      max_tokens: 4000
    },
    // Pass through for later nodes
    target_section: data.target_section,
    citations: data.citations,
    orchestrator_guidance: data.orchestrator_guidance
  }
}];
